import React from 'react'

function NameList() {
  const names = [
    { id: 1, name: 'Diana', age: 28, skill: 'Vue' },
    'Clark',
    'Diana',
  ]
  const nameList = names.map((name) => <h2>{name}</h2>)
  return <div>{nameList}</div>
}

export default NameList
